import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import HelloWorld from './HelloWorld';
import CountingMachine from './CountingMachine';
import Caculator from './Caculator';
import './caculator.css';
import TextApp from './TextApp';
import FormalTextApp from './FormalTextApp'
import ToDoListPreviewApp from './ToDoListPreviewApp'
import FormalListApp from './FormalListApp'
import GetYoutubeSearch from './GetYoutubeSreach';
import CardApp from './CustomComponentTest/CardApp';

ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<CardApp/>, document.getElementById('card-app'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
